#
# TABLE STRUCTURE FOR: agent_company
#

DROP TABLE IF EXISTS `agent_company`;

CREATE TABLE `agent_company` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор контракта',
  `agent_ogrn` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'ОГРН агента',
  `agent_contract_number` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Номер договора с агентом',
  `agent_company_email` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Емейл агента',
  `dropvalue` int(11) DEFAULT NULL COMMENT 'Текущий размер вознаграждения агента за заявки на подключение ККТ',
  `fullname` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Полное название агента',
  `agent_inn` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'ИНН агента',
  `agent_status` tinyint(1) DEFAULT NULL COMMENT 'Статус активен/неактивен',
  `with_nds` tinyint(1) DEFAULT NULL COMMENT 'Агент работает с НДС',
  `ag_contract_date` datetime DEFAULT NULL COMMENT 'Дата заключения договора',
  `dropvalue_prolongation` int(11) DEFAULT NULL COMMENT 'Текущий размер вознаграждения агента за заявки на продление ККТ',
  `create_date` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `change_date` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: agents
#

DROP TABLE IF EXISTS `agents`;

CREATE TABLE `agents` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор пользователя',
  `agent_company_id` int(11) NOT NULL COMMENT 'Идентификатор компании',
  `agent_firstname` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Имя',
  `agent_lastname` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Фамилия',
  `agent_email` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'емейл',
  `agent_cell` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Номер мобильного телефона',
  `made_id` int(11) DEFAULT NULL COMMENT 'Уникальный идентификатор пользователя создавшего учетную запись, null - для суперпользователя, некоторый id - для пользователя, созданного другим пользователем ',
  `agent_login` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Логин для входа в ЛК клиента. У суперпользователя не заполняется. Используется номер договора',
  `agent_password` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Пароль для вход в ЛК клиента',
  `agent_user_block` tinyint(1) DEFAULT 0 COMMENT 'Флаг блокировки учетной записи пользователя',
  `create_date` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `change_date` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: company
#

DROP TABLE IF EXISTS `company`;

CREATE TABLE `company` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор компании',
  `caption` varchar(1024) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Название компании',
  `company_email` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Емайл компании',
  `company_inn` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'ИНН компании',
  `company_kpp` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'КПП компании',
  `company_telephone` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Телефон компании',
  `create_date` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `change_date` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_company_inn_kkp` (`company_inn`,`company_kpp`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Компания';



#
# TABLE STRUCTURE FOR: contracts
#

DROP TABLE IF EXISTS `contracts`;

CREATE TABLE `contracts` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор контракта',
  `company_id` int(11) NOT NULL COMMENT 'Идентификатор компании',
  `agent_company_id` int(11) DEFAULT NULL COMMENT 'Идентификатор агента',
  `contract_status` int(11) DEFAULT NULL COMMENT 'Статус отправки бумажного договора в ОФД',
  `onpaper` tinyint(1) DEFAULT NULL COMMENT 'Контракт подписан на бумаге',
  `afterpayment` tinyint(1) DEFAULT 0 COMMENT 'постоплата',
  `signdate` datetime DEFAULT NULL COMMENT 'Дата подписи договора',
  `end_date` datetime DEFAULT NULL COMMENT 'Дата окончания действия договора',
  `tarif` int(11) DEFAULT 2 COMMENT 'Идентификатор тарифа по СМС',
  `kkt_price` int(11) DEFAULT 3000 COMMENT 'Идентификатор тарифа по ККТ',
  `create_date` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `change_date` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Контракт';



#
# TABLE STRUCTURE FOR: kkt
#

DROP TABLE IF EXISTS `kkt`;

CREATE TABLE `kkt` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор контракта',
  `company_id` int(11) NOT NULL COMMENT 'Идентификатор компании',
  `contract_id` int(11) NOT NULL,
  `activated` tinyint(1) DEFAULT 0 COMMENT 'Признак активированной ККТ',
  `register_number_kkt` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `factory_number_fn` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `factory_number_kkt` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `trade_point_id` int(11) DEFAULT NULL,
  `locked_no_payment` tinyint(1) DEFAULT 1 COMMENT 'Признак заблокированной за неуплату',
  `agent_company_id` int(11) DEFAULT NULL,
  `request_id` int(11) DEFAULT NULL,
  `start_date` datetime DEFAULT NULL,
  `end_date` datetime DEFAULT NULL,
  `deactivation_date` datetime DEFAULT NULL,
  `create_date` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `change_date` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: replaced_fn_kkt
#

DROP TABLE IF EXISTS `replaced_fn_kkt`;

CREATE TABLE `replaced_fn_kkt` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор записи',
  `old_fn` varchar(56) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Старый фН',
  `new_fn` varchar(56) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Новый номер фискального накопителя',
  `kkt_id` int(11) DEFAULT NULL COMMENT '	Идентификатор ккт',
  `create_date` datetime DEFAULT current_timestamp() COMMENT 'Дата и время совершения за замены ФН',
  `replace_type` int(11) DEFAULT 0 COMMENT 'Тип сервиса в котором совершена замена ФН. 0 - сервис по отчету о перерегистрации ККТ. 1 - ручное изменение номера ФН. 2 - изменение с помощью заявки на замену ККТ',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Таблица замены номера ФН ККТ';



#
# TABLE STRUCTURE FOR: request
#

DROP TABLE IF EXISTS `request`;

CREATE TABLE `request` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор контракта',
  `company_id` int(11) NOT NULL COMMENT 'Идентификатор компании',
  `contract_id` int(11) NOT NULL,
  `agent_company_id` int(11) DEFAULT NULL,
  `request_type` int(11) DEFAULT NULL,
  `status` int(11) DEFAULT NULL,
  `afterpayment` tinyint(1) DEFAULT 0,
  `count_kkt` int(11) DEFAULT NULL,
  `kkt_price_id` int(11) DEFAULT NULL,
  `bill_sum` int(11) DEFAULT NULL,
  `bill_sum_with_discount` int(11) DEFAULT NULL,
  `signdate` datetime DEFAULT current_timestamp() COMMENT 'Время отправления приглашения дружить',
  `status_change_date` datetime DEFAULT NULL,
  `deleted` tinyint(1) DEFAULT NULL,
  `create_date` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `change_date` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: requests_kkts
#

DROP TABLE IF EXISTS `requests_kkts`;

CREATE TABLE `requests_kkts` (
  `request_id` int(11) NOT NULL COMMENT 'номер заявки',
  `kkt_id` int(11) NOT NULL COMMENT 'идентификатор ККТ',
  PRIMARY KEY (`request_id`,`kkt_id`) COMMENT 'Составной первичный ключ'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='таблица связи';



#
# TABLE STRUCTURE FOR: trade_point
#

DROP TABLE IF EXISTS `trade_point`;

CREATE TABLE `trade_point` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор контракта',
  `city` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `street` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `house` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `company_id` int(11) NOT NULL,
  `create_date` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `change_date` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Место установки ККТ';



#
# TABLE STRUCTURE FOR: users
#

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор пользователя',
  `company_id` int(11) NOT NULL COMMENT 'Идентификатор компании',
  `contract_id` int(11) NOT NULL COMMENT 'Номер контракта',
  `user_firstname` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Имя',
  `user_lastname` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Фамилия',
  `user_email` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'емейл',
  `user_cell` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Номер мобильного телефона',
  `made_id` int(11) DEFAULT NULL COMMENT 'Уникальный идентификатор пользователя создавшего учетную запись, null - для суперпользователя, некоторый id - для пользователя, созданного другим пользователем ',
  `user_login` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Логин для входа в ЛК клиента. У суперпользователя не заполняется. Используется номер договора',
  `user_password` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Пароль для вход в ЛК клиента',
  `user_block` tinyint(1) DEFAULT 0 COMMENT 'Флаг блокировки учетной записи пользователя',
  `create_date` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `change_date` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



